description:
Bertrand (Jacky Arnal) is alone. His young wife Jenny (Claudia van Statt) is away from Paris for a few days. Happy with the situation and finds himself quickly overwhelmed, with women... without knowing that Jenny perfects her sexual skills as well. When Jenny returns they will admit their respective adventures and decide to pursue those adventures together, to break the monotony of the household.

